import './App.css';
import BrowserRouter from "browser-router";
import Route from "route";
import Switch from "switch";
import Feed from "./Feed.js";


function App() {
  return (
    <div className="App">

      <header className="App-header">
        <h1>Header</h1>
      </header>
      <div className="App-body">
        <BrowserRouter>
            <Switch>
                <Route path="/Feed">
                    <Feed />
                </Route>
            </Switch>
        </BrowserRouter>      
        <h1>Body</h1>
      </div>
    </div>
  );
}

export default App;
